import { MapForm } from "../components/Forms/CRUD/MapForm";
import api from "../services/api";
import { Map } from "../types";
import { onSubmitProps } from "../interfaces";

async function onSubmit(props: onSubmitProps) {

    if (!props.file || !props.map) {
        return;
    }

    try{
        const formData = new FormData();
        const map_data = {
            map_id: props.map.map_id,
            map_desc: props.map.map_desc,
            map_atr: props.map.map_atr,
            map_value: props.map.map_value,
            map_subctg_id: props.map.map_subctg_id,
            choropleth: props.map.choropleth,
        }
        formData.append('file', props.file);
        formData.append('request', JSON.stringify(map_data));

        await api.post('/api/Data/mapas', {
            data: formData,
            headers: {
                'Content-Type': 'multipart/form-data',
            },
        });
        window.location.href='/'+props.map?.map_id;
    } catch (err) {
        console.log(err);
    }
}

function onCancel() {
    console.log("Cancel");
}

export const Upload: React.FC = () => {


    return (
        <MapForm {...{onSubmit, onCancel}}/>
    );
}
